INSERT INTO `about_us` VALUES (28,'قي','Rate us','منذ بداية عملياتنا وخدماتنا والقيم الأساسية هي المحرك الأساسي والمحفز لنا بشكل مستمر.','Since the beginning of our operations and services, the core values ​​have been the main driver and motivator for us continuously.','2023-01-01 17:55:41','2022-08-18 23:10:50','2023-01-01 17:55:41',NULL,'/aboutus/167255473604AB7941-77F5-428B-8CBD-F27EA52A9748.jpeg','first','[null,null,null,null]','/aboutus/1660839050bg.mp4'),(29,'الجودة','The quality','تلتزم مملكة المعجنات بالحفاظ على مستوى عال من الجودة، ليس فقط في الغذاء والخدمات ولكن أيضا بالبيئة المحيطة بها.','The Kingdom of Pastries is committing a high level of quality, not only in the food and service but also in the surrounding environment.','2023-01-01 17:56:21','2022-08-18 23:12:30','2023-01-01 17:56:21',NULL,'/aboutus/1665664758الجودة.jpg','bg-st','[null,null,null,null]',NULL),(34,'الابتكار','Innovation','نسعى جاهدين على الابتكار المستمر في منجاتنا من أجل تلبية جميع أذواق عملائنا. الطهاة لدينا يسعون لإرضاء مختلف الأذواق بخلق منتجات مبتكرة ذات نكهات فريدة.','Our chefs strive continuously to satisfy different tastes by creating innovative products with unique flavors.','2023-01-01 17:56:23','2022-08-18 23:18:40','2023-01-01 17:56:23',NULL,'/aboutus/16608395201647948321DSC_8300.jpg','bg-nd','[null,null,null,null]',NULL),(35,'النظافة','Cleanliness','صحة وسلامة عملائنا هما على رأس أولوياتنا ولتحقيق هذا الهدف نقوم بفحص دوري في المطبخ وجميع المرافق ذات الصلة في الفروع لدينا بما في ذلك على موظفينا داخل وخارج المطبخ.','Health and safety of our customers are our top priority. To achieve this, we do a periodic check in our branches including our employees inside and outside the kitchen.','2023-01-01 17:56:25','2022-08-18 23:21:11','2023-01-01 17:56:25',NULL,'/aboutus/1665665192النظافة2.png','with-bg','[null,null,null,null]',NULL),(36,'الاهتمام بالعملاء','Customer care','عملائنا هم خط الحياة لدينا والدافع من وراء كل عمل هو إرضاء أذواقهم وتحقيق الراحة لهم. نحن نؤمن إيمانا راسخا بأن لدى جميع عملائنا الحق في المطالبة بالجودة العالية والخدمة المميزة من قبلنا.','Our customers are our life line. Their satisfaction and comfort are the motive behind every work. We firmly believe that our customers have the right to demand superior quality and outstanding service from us.','2023-01-01 17:56:27','2022-08-18 23:23:31','2023-01-01 17:56:27',NULL,'/aboutus/166083981116528587354.jpg','bg-nd','[null,null,null,null]',NULL),(37,'نصل إلى عتبة منزلك','We come to you','نريد لعملائنا أن يزورونا في منافذ البيع والتمتع بالضيافة لدينا ولكن في نفس الوقت علينا أن نضمن أننا نصل لطلب عملائنا في جميع الوجهات القابلة للوصول.','We want our customers to visit us at our outlets and enjoy our hospitality.  However, we have to ensure that we can reach them in all destinations.','2023-01-01 17:56:29','2022-08-29 23:09:28','2023-01-01 17:56:29',NULL,'/aboutus/1665665411Untitled-1.png','bg-st','[null,null,null,null]',NULL),(38,'هذا نحن …','This is who we are …','على مدار العشرين عامًا الماضية ، كانت و مازالت مملكة المعجنات مطعمًا يهتم بالتطور و التعلم و النمو - لنكون الأفضل كما نحن الآن \r\n*** فالبنسبة لنا جودة الطعام هي كل شىء ، بدايةً من استخدام أفضل الخامات المتوفرة - مرورًا بتعلم وابتكار أفضل الطرق لطهي وصفاتنا - وصولًا إلى التأكد بأن منتجاتنا يتم التعامل معها بطريقة آمنة و في بيئة نظيفة حتى تصل إليك\r\n*** منذ السنوات الأولى ، أضفنا و طورنا الكثير ما نقوم به ؛ لدينا فريق مخصص فقط للابتكار وفريق آخر لمراقبة الجودة! *** على مر السنين ، زاد عدد موظفينا من اثني عشر موظفًا إلى أكثر من مائة الآن *** السعي وراء المعرفة والإبداع المخلص والعمل الجماعي الدؤوب وإرضاء ضيوفنا أمور جوهرية لمن نحن … فهذا نحن!','For the past twenty years, Kingdom of Pastries has been a restaurant ever curious to learn and grow, to be the best that we can be!  *** For us Food Quality is everything, starting from purchasing the best ingredients we can find - to learn and innovate ways to cook our recipes best - to the assurance that our food is handled and served by safe hands in a spotless environment, until it’s in your hands!  *** Since the early years, we have added many layers to what we do; we have a team dedicated only to innovation, another team to control quality!  *** Over the years we’ve grown our staff from a mere twelve, to now more than one hundred. \r\n*** Pursuit of knowledge, devout creativity, relentless teamwork, and pleasing our guests are essential to who we are!',NULL,'2023-01-01 18:03:15','2023-01-01 19:41:20',NULL,'/aboutus/167258935190A7DD0F-7AD6-4001-B065-B9BA54892958.jpeg','bg-st','[null,null,null,null]',NULL),(39,'جودتنا تسبق اسمنا','Quality is our First Concern','بالنسبة لنا جودة الطعام هي كل شىء ، بدايةً من استخدام أفضل الخامات المتوفرة - مرورًا بتعلم وابتكار أفضل الطرق لطهي وصفاتنا - وصولًا إلى التأكد بأن منتجاتنا يتم التعامل معها بطريقة آمنة و في بيئة نظيفة حتى تصل إليك.','For us Food Quality is everything, starting from purchasing the best ingredients we can find - to learn and innovate ways to cook our recipes best - to the assurance that our food is handled and served by safe hands in a spotless environment, until it’s in your hands.','2023-01-01 19:34:21','2023-01-01 18:18:26','2023-01-01 19:34:21',NULL,'/aboutus/16725894605F317DCF-B9FA-4E21-91CF-CAC45AAEE25F.jpeg','bg-st','[null,null,null,null]',NULL);
