INSERT INTO `jobs` VALUES (1,'مدير','Manager','السن لا يزيد عن ٣٠ سنة\r\nحسن المظهر و الخلق\r\nشهادة في تخصص العلوم الإدارية','Age not more than 30 years\r\nGood looking and good manners\r\nCertificate in Administrative Sciences',0,'مدير مطعم','Manager Manager Manager Manager Manager ManagerManager Manager Manager Manager Manager Manager','إدارة جميع العاملين بالمطعم ورفع مستوى إنتاجيتهم الى الحـد الأقصى\r\n تدريب ومتابعة تدريب جميع العاملين ( جدد – قدامى ) حسب الخطة الموضوعة من إدارة التدريب\r\nمتابعة صيانة واصلاح جميع المعدات المستخدمة فى التحـضير والتجهيز والخدمة بالتنسيق مع الادارة الهندسية','Managing all restaurant employees and raising their productivity to the maximum-\r\n Training and follow-up training of all employees (new - old) according to the plan set by the Training Department-\r\nFollow-up maintenance and repair of all equipment used in preparation, processing and service in coordination with the Engineering Department-',NULL,'2021-09-23 02:01:58','2022-06-22 21:12:03'),(2,'خدمة عملاء','Customer Service','سعودية الجنسية\r\nاللباقة في الحديث\r\nالقدرة على التعامل مع العملاء','000000',0,'كول سنتر','000000','الصبر\r\nالإصغاء\r\nالتواصل\r\nمعرفة المنتج','000000',NULL,'2021-09-23 02:08:19','2021-12-26 21:42:55'),(3,'محاسب زبائن (كاشير)','Cashier','محاسب زبائن للعمل في فروع مملكة المعجنات في المنطقة الشرقية','A customer accountant to work in the branches of the Kingdom of Pastries in the Eastern Province',1,NULL,NULL,'المسمي الوظيفي:\r\n- كاشير / كاشيرة.\r\nالشروط:\r\n1- شهادة الثانوية العامة أو ما يعادلها.\r\n2- يفضل خبرة سنة فأكثر.','Job title:\r\nCashier / cashier.\r\nthe conditions:\r\n1- A high school diploma or its equivalent.\r\n2- A year or more of experience is preferred.',NULL,'2022-06-22 21:16:54','2022-12-09 18:58:15');
