n rings, green pepper slices and mushroom pieces, covered with delicious banana rilla cheese and seasoned chicken pieces, and enjoy the new delicious taste','/blogs/1647940436بيتزا و صفائح-02.jpg',NULL,'2021-09-23 04:39:36','2022-09-06 16:30:09'),(4,'yur','yu','ytty','tdtrd','/blogs/post-4.jpg','2022-08-29 22:53:57','2022-08-07 17:03:56','2022-08-29 22:53:57');
